import React from "react";
import { NavLink } from "react-router-dom";
import "./home.css";
import web from "../src/images/home.jpg";

const Home = () => {
  return (
    <>
      <div className="container-fluid mainBox">
        <div className="row px-5 d-flex align-items-center justify-content-between">
          <div className="col-md-6 mx-auto text-center">
            <h1 className="intro fw-bolder">
              Hello, I'm <br></br>
              <span className="text-primary pt-3 name"> Satyam</span>
            </h1>
            <h4 className="pb-1 mt-3 about">
              Programmer Web Developer Photographer
            </h4>
            <NavLink to="/about">
              <button className="btn btn-outline-primary border-2 rounded-pill w-25 mt-5">
                About Me
              </button>
            </NavLink>
          </div>
          <div className="col-md-6 mx-auto homeRight">
            <img className="img-fluid" src={web} alt="logo" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
